 token usage, and output alignment. \r\n\r\nCollaborate with product owners, data scientists, and engineers to identify and prioritize AI use cases. \r\n\r\nStay current with the latest advancements in AI/ML, especially in the generative AI space. \r\n\r\nDocument model behavior, prompt iterations, and implementation decisions clearly for both technical and non-technical stakeholders. \r\n\r\nEnsure ethical and responsible AI development practices.\";s:6:\"skills\";s:825:\"Bachelor’s or Master’s degree in Computer Science, Engineering, Data Science, or a related field. \r\n\r\n2-5 years of proven experience working with LLMs (e.g., GPT, LLaMA, Claude, Mistral) in production or prototyping environments. \r\n\r\nStrong programming skills in Python, with experience using relevant libraries (e.g., Transformers, LangChain, OpenAI API, Hugging Face) \r\n\r\nPractical experience in prompt engineering, including prompt chaining, prompt tuning, and system message crafting. \r\n\r\nSolid foundation in machine learning concepts and natural language processing. \r\n\r\nStrong logical thinking and problem-solving skills with an ability to break down complex problems into structured solutions. \r\n\r\nExcellent communication skills – both written and verbal – to convey technical concepts to diverse stakeholders.\";s:6:\"points\";s:508:\"We are seeking a passionate and skilled AI/ML Developer with hands-on experience in Large Language Models (LLMs), Python, and prompt engineering. You will be responsible for designing, developing, and deploying AI-powered solutions using state-of-the-art machine learning models with a focus on language understanding and generation. This role requires a blend of technical depth, logical problem-solving, and strong communication skills to translate complex business requirements into scalable AI solutions.\";s:11:\"category_id\";i:12;s:5:\"state\";s:9:\"published\";s:8:\"latitude\";s:11:\"36.04734905\";s:9:\"longitude\";s:10:\"4.80467909\";}s:11:\"\0