ur Learning System and you will be supported by an HR member of our team.\r\n\r\nYour next responsibility is to complete the Starter Training Course to ensure that you can join a commercial project with the minimum necessary knowledge of the workflow and quality requirements.\";s:6:\"skills\";s:988:\"The tests cover knowledge of React and GraphQL for the front end, as well as PHP and MySQL for the back end. We also provide a Test Automation suite for you to test your work before submitting it. We have no issues and it\'s OK if you use AI and Copilot to pass our test.\r\n\r\nAnyone who completes the test is invited to a technical interview. We are confident that if you can complete the test task and the technical interview, you have the necessary background for us to guide you further on the path to engineering expertise and enterprise-level delivery.\r\n\r\nYour previous experience and education do not matter; what matters is your ability to deliver results starting from the test task, and your enthusiasm and openness to embrace new knowledge and processes. You can even fail the test and redo it; we will provide you with feedback and will appreciate your ability to act on it to improve and pass. Continuous learning and acting on feedback are among our core organizational values.\";s:6:\"points\";s:532:\"You will get support in career counseling from our HR department as each career path is unique taking into account your personal strengths and ambitions.\r\n\r\nA successful Junior Full-stack Developer usually moves to an Engineer position, further advancing to a Senior Engineer/Full Stack Engineer mastering the technology, communication, and business context of their work.\r\n\r\nFurther professional growth and development can lead to you becoming a Practice lead or a Team lead ultimately culminating in a co-CTO and Partner position.\";s:11:\"category_id\";i:6;s:5:\"state\";s:9:\"published\";s:8:\"latitude\";N;s:9:\"longitude\";N;}s:11:\"\0*\0original\";a:22:{s:2:\"