(136, '58c0362f-3455-462c-9e90-d8e0c927811c', 'database', 'emails-sending', '{\"uuid\":\"58c0362f-3455-462c-9e90-d8e0c927811c\",\"displayName\":\"App\\\\Jobs\\\\sendEmail\",\"job\":\"Illuminate\\\\Queue\\\\CallQueuedHandler@call\",\"maxTries\":null,\"maxExceptions\":null,\"failOnTimeout\":false,\"backoff\":null,\"timeout\":null,\"retryUntil\":null,\"data\":{\"commandName\":\"App\\\\Jobs\\\\sendEmail\",\"command\":\"O:18:\\\"App\\\\Jobs\\\\sendEmail\\\":2:{s:7:\\\"request\\\";a:18:{s:6:\\\"_token\\\";s:40:\\\"5hQogODcBA9p1OS52nqPQlb6RwuKYZq3KiDIOlae\\\";s:5:\\\"titre\\\";s:50:\\\"AI\\/ML Developer – LLM & Prompt Engineering Focus\\\";s:8:\\\"category\\\";s:2:\\\"12\\\";s:7:\\\"company\\\";s:6:\\\"SIELTH\\\";s:4:\\\"lieu\\\";s:5:\\\"Alger\\\";s:7:\\\"nb_post\\\";s:1:\\\"2\\\";s:6:\\\"skills\\\";s:1269:\\\"Bachelor’s or Master’s degree in Computer Science, Engineering, Data Science, or a related field. \\r\\n\\r\\n2-5 years of proven experience working with LLMs (e.g., GPT, LLaMA, Claude, Mistral) in production or prototyping environments. \\r\\n\\r\\nStrong programming skills in Python, with experience using relevant libraries (e.g., Transformers, LangChain, OpenAI API, Hugging Face) \\r\\n\\r\\nPractical experience in prompt engineering, including prompt chaining, prompt tuning, and system message crafting. \\r\\n\\r\\nSolid foundation in machine learning concepts and natural language processing. \\r\\n\\r\\nStrong logical thinking and problem-solving skills with an ability to break down complex problems into structured solutions. \\r\\n\\r\\nExcellent communication skills – both written and verbal – to convey technical concepts to diverse stakeholders. \\r\\n\\r\\nPreferred Qualifications :  \\r\\n\\r\\nExperience with model fine-tuning or reinforcement learning from human feedback (RLHF). \\r\\n\\r\\nFamiliarity with vector databases and retrieval-augmented generation (RAG) techniques. \\r\\n\\r\\nExposure to cloud platforms like AWS, Azure, or GCP. \\r\\n\\r\\nExperience with ML Ops, containerization (Docker), and model deployment pipelines. \\r\\n\\r\\nContributions to open-source AI\\/ML projects or publications in relevant areas.\\\";s:5:\\\"works\\\";s:764:\\\"Design, fine-tune, and deploy LLM-based solutions for real-world business problems. \\r\\n\\r\\nDevelop and optimize prompts to guide model behavior for various use cases. \\r\\n\\r\\nWrite clean, efficient, and scalable Python code for model development and integration. \\r\\n\\r\\nAnalyze model performance and troubleshoot issues with data quality, token usage, and output alignment. \\r\\n\\r\\nCollaborate with product owners, data scientists, and engineers to identify and prioritize AI use cases. \\r\\n\\r\\nStay current with the latest advancements in AI\\/ML, especially in the generative AI space. \\r\\n\\r\\nDocument model behavior, prompt iterations, and implementation decisions clearly for both technical and non-technical stakeholders. \\r\\n\\r\\nEnsure ethical and responsible AI development practices.\\\";s:6:\\\"points\\\";s:508:\\\"We are seeking a passionate and skilled AI\\/ML Developer with hands-on experience in Large Language Models (LLMs), Python, and prompt engineering. You will be responsible for designing, developing, and deploying AI-powered solutions using state-of-the-art machine learning models with a focus on language understanding and generation. This role requires a blend of technical depth, logical problem-solving, and strong communication skills to translate complex business requirements into scalable AI solutions.\\\";s:7:\\\"website\\\";s:22:\\\"https:\\/\\/www.sielth.com\\\";s:5:\\\"tool1\\\";N;s:5:\\\"tool2\\\";N;s:5:\\\"tool3\\\";N;s:5:\\\"tools\\\";a:4:{i:0;s:1:\\\"4\\\";i:1;s:1:\\\"6\\\";i:2;s:1:\\\"7\\\";i:3;s:1:\\\"9\\\";}s:9:\\\"workowner\\\";s:1:\\\"1\\\";s:8:\\\"latitude\\\";s:17:\\\"36.78837018993997\\\";s:9:\\\"longitude\\\";s:18:\\\"3.0180781249016553\\\";s:9:\\\"imagePath\\\";s:51:\\\"images\\/1zr8IKFLuSqTYSwxFatPC6idRC