(349, 'default', '{\"uuid\":\"f9f3d093-8a2e-442a-978c-c70912d5df01\",\"displayName\":\"App\\\\Events\\\\JobOfferCreated\",\"job\":\"Illuminate\\\\Queue\\\\CallQueuedHandler@call\",\"maxTries\":null,\"maxExceptions\":null,\"failOnTimeout\":false,\"backoff\":null,\"timeout\":null,\"retryUntil\":null,\"data\":{\"commandName\":\"Illuminate\\\\Broadcasting\\\\BroadcastEvent\",\"command\":\"O:38:\\\"Illuminate\\\\Broadcasting\\\\BroadcastEvent\\\":14:{s:5:\\\"event\\\";O:26:\\\"App\\\\Events\\\\JobOfferCreated\\\":1:{s:5:\\\"offer\\\";a:19:{s:4:\\\"site\\\";s:125:\\\"https:\\/\\/www.linkedin.com\\/company\\/scandiweb\\/life?lipi=urn%3Ali%3Apage%3Ad_flagship3_job_details%3BZsyeg24iQmKoJS6z4gmL2w%3D%3D\\\";s:5:\\\"titre\\\";s:44:\\\"junior Full-stack Developer (React.js + PHP)\\\";s:7:\\\"company\\\";s:9:\\\"scandiweb\\\";s:4:\\\"lieu\\\";s:5:\\\"Alger\\\";s:7:\\\"nb_post\\\";s:1:\\\"2\\\";s:11:\\\"description\\\";N;s:9:\\\"workowner\\\";s:1:\\\"1\\\";s:6:\\\"skills\\\";s:988:\\\"The tests cover knowledge of React and GraphQL for the front end, as well as PHP and MySQL for the back end. We also provide a Test Automation suite for you to test your work before submitting it. We have no issues and it\'s OK if you use AI and Copilot to pass our test.\\r\\n\\r\\nAnyone who completes the test is invited to a technical interview. We are confident that if you can complete the test task and the technical interview, you have the necessary background for us to guide you further on the path to engineering expertise and enterprise-level delivery.\\r\\n\\r\\nYour previous experience and education do not matter; what matters is your ability to deliver results starting from the test task, and your enthusiasm and openness to embrace new knowledge and processes. You can even fail the test and redo it; we will provide you with feedback and will appreciate your ability to act on it to improve and pass. Continuous learning and acting on feedback are among our core organizational values.\\\";s:5:\\\"works\\\";s:460:\\\"Once you start your career at scandiweb, your first responsibility is to complete onboarding in the company, setting you up in all the processes and systems. This process is set forth in our Learning System and you will be supported by an HR member of our team.\\r\\n\\r\\nYour next responsibility is to complete the Starter Training Course to ensure that you can join a commercial project with the minimum necessary knowledge of the workflow and quality requirements.\\\";s:6:\\\"points\\\";s:532:\\\"You will get support in career counseling from our HR department as each career path is unique taking into account your personal strengths and ambitions.\\r\\n\\r\\nA successful Junior Full-stack Developer usually moves to an Engineer position, further advancing to a Senior Engineer\\/Full Stack Engineer mastering the technology, communication, and business context of their work.\\r\\n\\r\\nFurther professional growth and development can lead to you becoming a Practice lead or a Team lead ultimately culminating in a co-CTO and Partner position.\\\";s:5:\\\"tool1\\\";N;s:5:\\\"tool2\\\";N;s:5:\\\"tool3\\\";N;s:11:\\\"category_id\\\";s:1:\\\"6\\\";s:8:\\\"latitude\\\";s:17:\\\"36.71586858764501\\\";s:9:\\\"longitude\\\";s:18:\\\"3.1910949796960297\\\";s:10:\\\"updated_at\\\";s:27:\\\"2025-05-07T07:10:14.000000Z\\\";s:10:\\\"created_at\\\";s:27:\\\"2025-05-07T07:10:14.000000Z\\\";s:2:\\\"id\\\";i:280;}}s:5:\\\"tries\\\";N;s:7:\\\"timeout\\\";N;s:7:\\\"backoff\\\";N;s:13:\\\"maxExceptions\\\";N;s:10:\\\"connection\\\";N;s:5:\\\"queue\\\";N;s:5:\\\"delay\\\";N;s:11:\\\"afterCommit\\\";N;s:10:\\\"middleware\\\";a:0:{}s:7:\\\"chained\\\";a:0:{}s:15:\\\"chainConnection\\\";N;s:10:\\\"chainQueue\\\";N;s:19:\\\"chainCatchCallbacks\\\";N;}\"}}', 0, NULL, 1746601814, 1746601814),
