(279, 'devlopeur mobile', NULL, 'saber.dz', 'Setif', 34, '2025-05-05 14:19:47', '2025-05-05 14:27:22', 1, 'images/R7h3jjFfqsLybfxRpv3HRuabzrNrEfChlQmeOiTY.webp', 'https://fmi.univ-bba.dz/', 'visual', 'studio', 'code', NULL, 'develop and maintain mobile apps', '1+ year of experience building cross-platform mobile apps (Flutter or React Native)\r\n• Strong ability to translate Figma designs into clean, functional interfaces\r\n• Solid understanding of iOS development standards and performance optimization\r\n• Experience integrating APIs and working with Git\r\n• Autonomy, attention to detail, and a proactive mindset\r\n• Familiar with : Figma & Trello', 'We’re looking for a cross-platform Mobile Developer with good grasp of iOS-specific requirements.', 8, 'published', 36.19048678, 5.45103115),
(280, 'junior Full-stack Developer (React.js + PHP)', NULL, 'scandiweb', 'Alger', 2, '2025-05-07 06:10:14', '2025-05-07 06:13:55', 1, 'images/DolEqNwzfxQPLe9kuEt0eGgz73tHbRxN5Y6ADIoT.png', 'https://www.linkedin.com/company/scandiweb/life?lipi=urn%3Ali%3Apage%3Ad_flagship3_job_details%3BZsyeg24iQmKoJS6z4gmL2w%3D%3D', NULL, NULL, NULL, NULL, 'Once you start your career at scandiweb, your first responsibility is to complete onboarding in the company, setting you up in all the processes and systems. This process is set forth in our Learning System and you will be supported by an HR member of our team.\r\n\r\nYour next responsibility is to complete the Starter Training Course to ensure that you can join a commercial project with the minimum necessary knowledge of the workflow and quality requirements.', 'The tests cover knowledge of React and GraphQL for the front end, as well as PHP and MySQL for the back end. We also provide a Test Automation suite for you to test your work before submitting it. We have no issues and it\'s OK if you use AI and Copilot to pass our test.\r\n\r\nAnyone who completes the test is invited to a technical interview. We are confident that if you can complete the test task and the technical interview, you have the necessary background for us to guide you further on the path to engineering expertise and enterprise-level delivery.\r\n\r\nYour previous experience and education do not matter; what matters is your ability to deliver results starting from the test task, and your enthusiasm and openness to embrace new knowledge and processes. You can even fail the test and redo it; we will provide you with feedback and will appreciate your ability to act on it to improve and pass. Continuous learning and acting on feedback are among our core organizational values.', 'You will get support in career counseling from our HR department as each career path is unique taking into account your personal strengths and ambitions.\r\n\r\nA successful Junior Full-stack Developer usually moves to an Engineer position, further advancing to a Senior Engineer/Full Stack Engineer mastering the technology, communication, and business context of their work.\r\n\r\nFurther professional growth and development can lead to you becoming a Practice lead or a Team lead ultimately culminating in a co-CTO and Partner position.', 6, 'published', 36.71196158, 3.19273514),
(282, 'junior Full-stack Developer (React.js + PHP)', '\"You will get support in career counseling from our HR department as each career path is unique taking into account your personal strengths and ambitions.\\r\\n\\r\\nA successful Junior Full-stack Developer usually moves to an Engineer position, further advancing to a Senior Engineer\\/Full Stack Engineer mastering the technology, communication, and business context of their work.\\r\\n\\r\\nFurther professional growth and development can lead to you becoming a Practice lead or a Team lead ultimately culminating in a co-CTO and Partner position.\"', 'scandiweb', 'Alger', 2, '2025-05-07 12:03:09', '2025-05-18 13:45:06', 1, 'images/DBV7FGLKftrmGZTESk6XbbYavuw8hpRbcjJZKfUF.jpg', 'https://www.linkedin.com/company/scandiweb/life?lipi=urn%3Ali%3Apage%3Ad_flagship3_job_details%3BZsyeg24iQmKoJS6z4gmL2w%3D%3D', NULL, NULL, NULL, NULL, 'Once you start your career at scandiweb, your first responsibility is to complete onboarding in the company, setting you up in all the processes and systems. This process is set forth in our Learning System and you will be supported by an HR member of our team.\r\n\r\nYour next responsibility is to complete the Starter Training Course to ensure that you can join a commercial project with the minimum necessary knowledge of the workflow and quality requirements.', 'The tests cover knowledge of React and GraphQL for the front end, as well as PHP and MySQL for the back end. We also provide a Test Automation suite for you to test your work before submitting it. We have no issues and it\'s OK if you use AI and Copilot to pass our test.\r\n\r\nAnyone who completes the test is invited to a technical interview. We are confident that if you can complete the test task and the technical interview, you have the necessary background for us to guide you further on the path to engineering expertise and enterprise-level delivery.\r\n\r\nYour previous experience and education do not matter; what matters is your ability to deliver results starting from the test task, and your enthusiasm and openness to embrace new knowledge and processes. You can even fail the test and redo it; we will provide you with feedback and will appreciate your ability to act on it to improve and pass. Continuous learning and acting on feedback are among our core organizational values.', 'You will get support in career counseling from our HR department as each career path is unique taking into account your personal strengths and ambitions.\r\n\r\nA successful Junior Full-stack Developer usually moves to an Engineer position, further advancing to a Senior Engineer/Full Stack Engineer mastering the technology, communication, and business context of their work.\r\n\r\nFurther professional growth and development can lead to you becoming a Practice lead or a Team lead ultimately culminating in a co-CTO and Partner position.', 6, 'published', NULL, NULL),
(283, 'Back End Developer - C#/.NET', '\"Join micro1 as a Backend C#\\/.NET Developer and become a vital part of our innovative and dynamic team. You will be responsible for developing robust server-side logic and must have a passion for code excellence and optimization. With our connections to some of the finest Silicon Valley companies, enjoy a flexible work environment that fuels professional growth.\"', 'micro 1', 'Annaba', 5, '2025-05-17 10:34:53', '2025-05-19 13:57:38', 1, 'images/yYQvhPOTYQyp9dht0ZGiBCDdB8f6wIAGn80LLOX4.jpg', 'https://www.linkedin.com/company/micro1/life/?lipi=urn%3Ali%3Apage%3Ad_flagship3_job_details%3BNBXWuQs%2BTEmXw5kHfrKvZA%3D%3D', 'C#', '.Net frame work', 'mySql', NULL, 'Develop and maintain web services and APIs to meet business requirements\r\n- Ensure high code quality, effective architecture, and maintainability\r\n- Optimize backend processing for performance and scalability\r\n- Collaborate with front-end developers for seamless integration\r\n- Conduct code reviews and provide constructive feedback\r\n- Troubleshoot and resolve software defects\r\n- Stay updated with emerging technologies and apply best practices', 'Strong experience with C# and .NET frameworks\r\n- Proficiency in MySQL database design and management\r\n- Excellent written and verbal communication skills\r\n- Demonstrated ability to develop server-side applications\r\n- Strong problem-solving capabilities and analytical skills\r\n- Ability to work independently and as part of a remote team', 'Join micro1 as a Backend C#/.NET Developer and become a vital part of our innovative and dynamic team. You will be responsible for developing robust server-side logic and must have a passion for code excellence and optimization. With our connections to some of the finest Silicon Valley companies, enjoy a flexible work environment that fuels professional growth.', 6, 'published', 36.88341052, 7.75246331),
(284, 'IT/Data Analyst Intern', '\"At Smollan, we\\u2019re on an evolutionary journey where we\\u2019re shifting our story. We\\u2019re looking for truly unique people who believe in fostering a diverse and inclusive environment. Where our people are cared for, happy and inspired in building an extraordinary place to work.\\r\\n\\r\\n\\r\\nWe\\u2019re on the looking for qualified graduates with completed degree to join us as an IT\\/Data Analyst Intern in Algeria.\"', 'smollan', 'Alger', 5, '2025-05-20 11:22:23', '2025-05-20 11:22:23', 1, 'images/hpDgI6aKlLrjJ6w1Mt3arauzspsyDyGZLRtvXMft.jpg', 'https://smollan.com/', NULL, NULL, NULL, NULL, 'Full time internship with a global organisation\r\nTo gain exposure and experience in all areas within our business through the participation in this internship programme.\r\nAccess to large data base and adding valuable impact.', 'Be able to work full time\r\nStrong communication skills in English and French verbal & written)\r\nFlexibility and going the extra mile to achieve desired results\r\nExcellent skills using MS Suite (especially excel and PowerBI)\r\n0 – 3 months experience internships\r\nCompleted university qualification (Degree and above)\r\nEffective analysis and report writing skills actioning and administrative structures - UI experience\r\nKnowledge of key programming language e.g. Python, VBA etc.\r\nAnalysis & Problem Solving\r\nPlanning & organising\r\nAbility to follow instructions & procedures\r\nAbility to cope with pressure\r\nPresentation Skills\r\nAbility to carry out research', 'At Smollan, we’re on an evolutionary journey where we’re shifting our story. We’re looking for truly unique people who believe in fostering a diverse and inclusive environment. Where our people are cared for, happy and inspired in building an extraordinary place to work.\r\n\r\n\r\nWe’re on the looking for qualified graduates with completed degree to join us as an IT/Data Analyst Intern in Algeria.', 11, 'published', 36.75283733, 3.05260065),
