, 5.41807216),
(288, 'Senior Software Engineer', '\"If you\'re passionate about building high-impact products and working in a fast-paced, product-focused environment, this is your chance to make a difference.\"', 'BRQIoud', 'Alger', 4, '2025-05-20 13:12:33', '2025-05-20 13:12:33', 1, 'images/dHMHbWHMUQTaj0nt3LJJCPy7X64p5eneke8Ih9Hz.jpg', 'https://www.linkedin.com/company/brqloud/life?lipi=urn%3Ali%3Apage%3Ad_flagship3_jobs_discovery_jymbii%3BPlgiP2Q1R6S8rTXpH5XSNQ%3D%3D', NULL, NULL, NULL, NULL, 'Design and develop robust backend systems (NestJS, Node.js, etc.)\r\nLead development efforts and mentor junior team members\r\nCollaborate closely with product and design teams to ship features\r\nParticipate in architecture decisions and code reviews', '5+ years of experience in software development\r\nStrong backend expertise with modern frameworks\r\nClean coding practices and strong problem-solving skills\r\nExperience with cloud services, APIs, and scalable architecture', 'If you\'re passionate about building high-impact products and working in a fast-paced, product-focused environment, this is your chance to make a difference.', 15, 'published', 36.74502780, 3.02848189),
(294, 'Senior Software Engineer', '\"If you\'re passionate about building high-impact products and working in a fast-paced, product-focused environment, this is your chance to make a difference.\"', 'BRQIoud', 'Alger', 4, '2025-05-20 13:54:00', '2025-05-20 13:54:00', 1, 'images/x7OycOPZ72lVFcHfXFGNebYrELsLB3bFR6MR3ZsZ.jpg', 'https://www.linkedin.com/company/brqloud/life?lipi=urn%3Ali%3Apage%3Ad_flagship3_jobs_discovery_jymbii%3BPlgiP2Q1R6S8rTXpH5XSNQ%3D%3D', NULL, NULL, NULL, NULL, 'Design and develop robust backend systems (NestJS, Node.js, etc.)\r\nLead development efforts and mentor junior team members\r\nCollaborate closely with product and design teams to ship features\r\nParticipate in architecture decisions and code reviews', '5+ years of experience in software development\r\nStrong backend expertise with modern frameworks\r\nClean coding practices and strong problem-solving skills\r\nExperience with cloud services, APIs, and scalable architecture', 'If you\'re passionate about building high-impact products and working in a fast-paced, product-focused environment, this is your chance to make a difference.', 15, 'published', NULL, NULL),
(298, 'AI/ML Developer – LLM & Prompt Engineering Focus', '\"We are seeking a passionate and skilled AI\\/ML Developer with hands-on experience in Large Language Models (LLMs), Python, and prompt engineering. You will be responsible for designing, developing, and deploying AI-powered solutions using state-of-the-art machine learning models with a focus on language understanding and generation. This role requires a blend of technical depth, logical problem-solving, and strong communication skills to translate complex business requirements into scalable AI solutions.\"', 'SIELTH', 'Alger', 2, '2025-05-25 08:52:01', '2025-05-27 06:48:57', 1, 'images/5ntUk1CyHFoCnHk3ag3k2hUVvsndRIRiTz9EVYu4.jpg', 'https://www.sielth.com', NULL, NULL, NULL, NULL, 'Design, fine-tune, and deploy LLM-based solutions for real-world business problems. \r\n\r\nDevelop and optimize prompts to guide model behavior for various use cases. \r\n\r\nWrite clean, efficient, and scalable Python code for model development and integration. \r\n\r\nAnalyze model performance and troubleshoot issues with data quality, token usage, and output alignment. \r\n\r\nCollaborate with product owners, data scientists, and engineers to identify and prioritize AI use cases. \r\n\r\nStay current with the latest advancements in AI/ML, especially in the generative AI space. \r\n\r\nDocument model behavior, prompt iterations, and implementation decisions clearly for both technical and non-technical stakeholders. \r\n\r\nEnsure ethical and responsible AI development practices.', 'Bachelor’s or Master’s degree in Computer Science, Engineering, Data Science, or a related field. \r\n\r\n2-5 years of proven experience working with LLMs (e.g., GPT, LLaMA, Claude, Mistral) in production or prototyping environments. \r\n\r\nStrong programming skills in Python, with experience using relevant libraries (e.g., Transformers, LangChain, OpenAI API, Hugging Face) \r\n\r\nPractical experience in prompt engineering, including prompt chaining, prompt tuning, and system message crafting. \r\n\r\nSolid foundation in machine learning concepts and natural language processing. \r\n\r\nStrong logical thinking and problem-solving skills with an ability to break down complex problems into structured solutions. \r\n\r\nExcellent communication skills – both written and verbal – to convey technical concepts to diverse stakeholders.', 'We are seeking a passionate and skilled AI/ML Developer with hands-on experience in Large Language Models (LLMs), Python, and prompt engineering. You will be responsible for designing, developing, and deploying AI-powered solutions using state-of-the-art machine learning models with a focus on language understanding and generation. This role requires a blend of technical depth, logical problem-solving, and strong communication skills to translate complex business requirements into scalable AI solutions.', 12, 'published', 36.04734905, 4.80467909);

